func page(p1 net.Conn, f Frame) {
	page := int(f.data[6])
	buf := grid.GetPage(page)
	Vf(2, "[page]%d, %X\n", page, buf)
	if buf != nil {
		writeRawFrame(p1, "9D 03 F0 03 26 08 85 35 00 00 06")
		p1.Write(buf)
	}
}


func main() {
	log.SetFlags(log.Ldate|log.Ltime)
	flag.Parse()

	readyCh := make(chan struct{}, 1)
	go func() {
		stdin := bufio.NewReader(os.Stdin)

		for {
			err := readData()
			if err != nil {
				Vf(1, "Read Data Error: %v\n\n", err)
				continue
			}
			select {
			case readyCh <- struct{}{}:
			default:
			}


			_, err = stdin.ReadString('\n')
			if err != nil {
				break
			}
		}
	}()

	<- readyCh

	srvStart()
}

func srvStart() {
	ln, err := net.Listen("tcp", *localAddr)
	if err != nil {
		Vln(2, "[server]Error listening:", err)
		return
	}
	defer ln.Close()

	Vf(2, "Listening: %v\n\n", *localAddr)

	for {
		conn, err := ln.Accept()
		if err != nil {
			log.Println(err)
			continue
		}
		go handleConn(conn)
	}
}

func readData() (error) {
	af, err := os.Open(*userData)
	if err != nil {
		Vln(2, "[open]", err)
		return err
	}
	defer af.Close()

	grid2 := NewGrid()

	idx := 0
	r := bufio.NewReader(af)
	b, err := r.Peek(3)
	if err != nil {
		return err
	}
	if b[0] == 0xEF && b[1] == 0xBB && b[2] == 0xBF {
		r.Discard(3)
	}
	for {
		line, err := r.ReadString('\n')
		if err != nil {
			break
		}

		fields := strings.Split(strings.Trim(line, "\n\r"), "\t")
		if fields[0] == "" {
			continue
		}
		if strings.HasPrefix(fields[0], "#") {
			continue
		}

		Vln(4, "[dbg]", fields)

		var rid uint16 = 0x4286
		var C4 []byte = []byte{0xFF, 0xFF, 0xFF, 0xFF}
		var wing uint8 = 0
		var wingLv []byte = []byte{0x00, 0x00, 0x00, 0x00}
		var Lv uint8 = 13
		var exp uint32 = 12345
		var sess uint32 = 23333

		switch len(fields) {
		case 7:
			tmp, _ := strconv.ParseUint(fields[6], 10, 32)
			sess = uint32(tmp)
			fallthrough
		case 6:
			tmp, _ := strconv.ParseUint(fields[5], 10, 32)
			exp = uint32(tmp)
			fallthrough
		case 5:
			tmp, _ := strconv.ParseUint(fields[4], 10, 8)
			if tmp >= 1 && tmp <= 13 {
				Lv = uint8(tmp)
			}
			fallthrough
		case 4:
			wingLv, _ = hex.DecodeString(fields[3])
			fallthrough
		case 3:
			tmp, _ := strconv.ParseUint(fields[2], 10, 8)
			wing = uint8(tmp)
			fallthrough
		case 2:
			C4, _ = hex.DecodeString(fields[1])
			fallthrough
		case 1:
			tmp, _ := hex.DecodeString(fields[0])
			if len(tmp) == 2 {
				rid = (uint16(tmp[1]) << 8) | uint16(tmp[0])
			}

		default:
			Vln(1, "[open]?!!")
		}

		bot := NewBot(rid)
		bot.C4 = C4
		bot.Lv = Lv
		bot.Exp = exp
		bot.Sess = sess
		bot.Wing = wing
		bot.WingLv = wingLv


		Vf(4, "[dbg][open]%04X, %04X, %d, %04X\n", rid, C4, wing, wingLv)
		Vf(4, "[dbg][open]%v, %X", bot, bot.GetBytes(idx))
		idx += 1

		grid2.Add(bot)
	}

	grid2.BuildCached()
	grid = grid2

	Vln(4, "[dbg][grid]", len(grid.Robot), len(grid.buf))
	return nil
}


func Vf(level int, format string, v ...interface{}) {
	if level <= *verbosity {
		log.Printf(format, v...)
	}
}
func V(level int, v ...interface{}) {
	if level <= *verbosity {
		log.Print(v...)
	}
}
func Vln(level int, v ...interface{}) {
	if level <= *verbosity {
		log.Println(v...)
	}
}




